import React from "react";
import Img from "./note-icon.svg";

const Header = () => {
  return (
    <>
      <div>
        <img src={Img} style={{ width: 50, height: 35, display: "inline" }} />
        <h1 style={{ display: "inline" }}>Yash Keep</h1>
      </div>
    </>
  );
};

export default Header;
